import { useEffect, useState } from "react";

export default function Manager() {
    const [isLoading, setIsLoading] = useState(true);

    return (
        <div>
            <h2>관리자 계정 발급</h2>
            <section className="manager-section">
                사용할 이메일 : <input type="email" />
                사용할 이름 : <input type="text" />
            </section>

        </div>
    )
}
